body {
    display: grid;
    grid-template-areas:
    "sidebar header"
    "sidebar content1"
    "sidebar content2"
    "footer footer";
    gap: 40px;
    background-color: rgb(153, 182, 228);
    font-family: Arial, Helvetica, sans-serif;
}

@media (max-width: 600px) {
    body {
        grid-template-columns: 1fr;
        grid-template-areas:
        "sidebar"
        "header" 
        "content1"
        "content2"
        "footer";
    }
}

